function checkform(form) {
  // get all the inputs within the submitted form
  var inputs = form.getElementsByTagName('input');
  for (var i = 0; i < inputs.length; i++)
  {
    if(inputs[i].hasAttribute("required"))
    {
      if(inputs[i].value == "")
      {
        message.style.opacity = "1";
        return false;
      }
    }
  }
  return true;
}


$(document).on('confirmation', '.remodal', function () {
  if (checkform(form))
  {
    spinner2.classList.remove("hidden");
    var fields = {};
    var _athleteId = 0;
    for(var i=0; i<formElem.length; i++)
    {
      fields[formElem[i].name] = formElem[i].value;
      if ("athleteId" == formElem[i].name) {
          _athleteId = formElem[i].value;
      }
    }

    if (_athleteId && _athleteId > 0)
        Athletes.saveAthlete(_athleteId, fields, athleteCreated, errorReceived);
    else
        Athletes.createAthlete(fields, athleteCreated, errorReceived);
  }
});


